Hello, my darling Sweet Potato! 🍠💕

No hate towards this sweet potato! It has become quite common to comment on someone’s weight when we notice a change, but my darling, we have evolved! When you compliment someone on their weight loss, it implies that their beauty is solely dependent on the size of their body. And we all know that’s a myth, right?! Even with the best intentions, let’s agree to give people compliments without explicitly mentioning how much weight they’ve lost. “You’re glowing” should be sufficient. I can confidently say that all my sweet potatoes look fabulous, regardless.

By the way, my glow is the result of me finally prioritizing self.

